[i]Acknowledging[/i] the names and flags of member states belong not merely to their individual governments, but to the sapients they represent, and therefore should not be licensed or marketed;
[i]Believing[/i] that all sapients have the right to free and fairly use the shared symbols and icons of the governmental organizations that represent them;
Therefore, the following shall be enacted: [list=1][*]The World Assembly, member states, and municipal subdivisions thereof are required to release their flags and names into the public domain. [*]Member states shall have the sole right to define what is or is not their intellectual property. [*]Member states shall protect by law the use of their intellectual property, as defined above, for artistic expression with the following exceptions: [list=a][*]Usages involving impersonation, fraud, deception, or other forms of misrepresentation of either a member state government or their subdivisions, the World Assembly, or a representative thereof; or [*]Limitations in place from previous law enacted by the World Assembly.[/list][/list]
